function addAnimation() {
  var scrollers = document.querySelectorAll('.scroller');
  scrollers.forEach(function (scroller) {
    var scrollerInner = scroller.querySelector('.scroller__inner');
    var scrollerContent = Array.from(scrollerInner.children);
    scrollerContent.forEach(function (item) {
      var duplicatedItem = item.cloneNode(true);
      duplicatedItem.setAttribute('aria-hidden', true);
      scrollerInner.appendChild(duplicatedItem);
    });
  });
}
var sliderInner1 = document.getElementById('slides-stage');
var prev1 = document.getElementById('prev-stages');
var next1 = document.getElementById('next-stages');
var stagesBlock = document.querySelector('.stages__pagination');
var pageCollection = stagesBlock.getElementsByClassName('pagination__symbol');
var slideAmount = 5;
var slideWidth1 = 335;
var slideGap1 = 20;
var currentSlide1 = 1;
prev1.addEventListener('click', function () {
  shiftSlide('prev');
});
next1.addEventListener('click', function () {
  shiftSlide('next');
});
function shiftSlide(direction) {
  var currentPos1 = 0;
  if (direction === 'prev') {
    currentSlide1 -= 1;
    changePagePrev(currentSlide1);
    if (currentSlide1 == slideAmount - 1) {
      toggleClass(next1, 'disabled');
    }
    if (currentSlide1 == 1) {
      toggleClass(prev1, 'disabled');
    }
  } else {
    currentSlide1 += 1;
    changePageNext(currentSlide1);
    if (currentSlide1 == 2) {
      toggleClass(prev1, 'disabled');
    }
    if (currentSlide1 == slideAmount) {
      toggleClass(next1, 'disabled');
    }
  }
  currentPos1 = -(slideWidth1 + slideGap1) * (currentSlide1 - 1);
  sliderInner1.style.left = "".concat(currentPos1, "px");
}
function toggleClass(node, className) {
  node.classList.toggle(className);
}
function changePageNext(number) {
  pageCollection[number - 1].classList.toggle('active');
  if (number > 1) {
    pageCollection[number - 2].classList.toggle('active');
  }
}
function changePagePrev(number) {
  pageCollection[number - 1].classList.toggle('active');
  if (number < slideAmount) {
    pageCollection[number].classList.toggle('active');
  }
}

